Stephanie Plum (Katherine Heigl), geen cent te makken en werkeloos, chanteert haar neef Vinnie van het bureau Borgstelling en Incasso om haar een baan te geven als premiejager. Haar eerste opdracht: de aanhouding van Joe Morelli (Jason O'Mara), voormalig politieman en nu beschuldigd van moord. Saillant detail: Morelli is de supermacho die Stephanie op haar zestiende ontmaagdde en vervolgens de onthullende details schreef op de muur van het toilet van Mario's Lunchroom.



